import styled from "styled-components";

export const Container = styled.div`
    width:100%;
    display:flex;
    justify-content:flex-:end;
  svg {
    width: 40px;
    height: 40px;
  }
  svg path {
    fill: ${props => (props.currentTheme === "light" ? "#0b0316" : "#d6d9e3")};
  }
`;
